nce. Symptoms include re-experiencing the traumatic event and numbing of responsiveness to or reduced involvement with the external world.','en',1,'2007-10-18 04:28:24',1,NULL,'3854FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3911,114100,'Inflammation of the lungs.','en',1,'2007-11-02 20:06:58',1,NULL,'3911FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(3941,114174,'Inflammation of a vein associated with thrombus formation.','en',1,'2007-10-18 04:28:24',1,NULL,'3941FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4485,115797,'Generic term for diseases caused by an abnormal metabolic process. It can be congenital due to inherited enzyme abnormality (METABOLISM, INBORN ERRORS) or acquired due to disease of an endocrine organ or failure of a metabolically important organ such as the liver. (Stedman, 26th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'4485FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4501,115835,'Inflammation of the coverings of the brain and/or spinal cord, which consist of the PIA MATER; ARACHNOID; and DURA MATER. Infections (viral, bacterial, and fungal) are the most common causes of this condition, but subarachnoid hemorrhage (HEMORRHAGES, SUBARACHNOID), chemical irritation (chemical MENINGITIS), granulomatous conditions, neoplastic conditions (e.g., carcinomatous meningitis), and other inflammatory conditions may produce this syndrome. (From Joynt, Clinical Neurology, 1994, Ch24, p6)','en',1,'2007-11-02 20:02:40',1,'2011-12-22 18:03:16','4501FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4639,116128,'A protozoan disease caused by four species of the genus PLASMODIUM (P. falciparum (MALARIA, FALCIPARUM), P. vivax (MALARIA, VIVAX), P. ovale, and P. malariae) and transmitted by the bite of an infected female mosquito of the genus Anopheles. Malaria is endemic in parts of Asia, Africa, Central and South America, Oceania, and certain Caribbean islands. It is characterized by extreme exhaustion associated with paroxysms of high fever, sweating, shaking chills, and anemia.','en',1,'2007-11-02 19:28:08',1,'2012-06-03 17:14:05','4639FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4676,116214,'Abnormally low blood pressure seen in shock but not necessarily indicative of it. (Dorland, 28th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'4676FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4719,116376,'A sudden, nonconvulsive loss of neurologic function due to an ischemic or hemorrhagic intracranial vascular event. In general, cerebrovascular accidents are classified by anatomic location in the brain, vascular distribution, etiology, age of the affected individual, and hemorrhagic vs. nonhemorrhagic nature. (From Adams et al., Principles of Neurology, 6th ed, pp777-810)','en',1,'2007-10-18 04:28:24',1,NULL,'4719FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4745,116474,'The lack of sufficient energy or protein to meet the body\'s metabolic demands, as a result of either an inadequate dietary intake of protein, intake of poor quality dietary protein, increased demands due to disease, or increased nutrient losses.','en',1,'2007-10-18 04:28:24',1,'2011-12-22 17:51:40','4745FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4775,116543,'Injuries to tissues caused by contact with heat, steam, chemicals (BURNS, CHEMICAL), electricity (BURNS, ELECTRIC), or the like.','en',1,'2007-10-18 04:28:24',1,NULL,'4775FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4831,116700,'Infestation with parasitic worms of the helminth class.','en',1,'2007-10-18 04:28:24',1,NULL,'4831FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4929,117146,'Infections in birds and mammals produced by various species of Trichomonas.','en',1,'2007-10-18 04:28:24',1,NULL,'4929FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4933,117152,'SCHISTOSOMIASE','fr',1,'2007-09-06 09:05:28',1,NULL,'4933FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(4978,117315,'The condition that results from excessive loss of body water.','en',1,'2007-10-18 04:28:24',1,NULL,'4978FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5005,117386,'Hypertrophy or enlargement of the heart.','en',1,'2007-10-18 04:28:24',1,NULL,'5005FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5205,117829,'Herpes simplex of the genitals.','en',1,'2007-10-18 04:28:24',1,NULL,'5205FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5228,117889,'Inflammation of the lining of the stomach and intestines, often accompanied by diarrhea.','en',1,'2007-11-02 20:20:58',1,NULL,'5228FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5445,118652,'Cerebral tissue herniation through a congenital or acquired defect in the skull. The majority of congenital encephaloceles occur in the occipital or frontal regions. Clinical features include a protuberant mass that may be pulsatile. The quantity and location of protruding neural tissue determines the type and degree of neurologic deficit. Visual defects, psychomotor developmental delay, and persistent motor deficits frequently occur.','en',1,'2007-10-18 04:28:24',1,NULL,'5445FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5495,118789,'Difficulty in swallowing.','en',1,'2007-11-02 20:15:17',1,NULL,'5495FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5600,119112,'Diseases of the central and peripheral nervous system. This includes disorders of the brain, spinal cord, cranial nerves, peripheral nerves, nerve roots, autonomic nervous system, neuromuscular junction, and muscle.','en',1,'2007-10-18 04:28:24',1,NULL,'5600FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5623,119204,'The state of the body in relation to the intake and excretion of water and electrolytes, particularly sodium and potassium. It exists in a metabolic balance internally with BODY FLUID COMPARTMENTS, total BODY WATER, BLOOD VOLUME, EXTRACELLULAR SPACE, etc., externally through sensible and insensible SWEATING. The hypothalamus controls water balance. (Dorland, 27th ed; Mountcastle, Medical Physiology, 14th ed, 1980, p1152)','en',1,'2007-10-18 04:28:24',1,NULL,'5623FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5626,119240,'Diseases of the ear, general or unspecified.','en',1,'2007-10-18 04:28:24',1,NULL,'5626FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5662,119356,'Infection of humans or animals with hookworms other than those caused by the genus Ancylostoma or Necator, for which the specific terms ANCYLOSTOMIASIS and NECATORIASIS are available.','en',1,'2007-10-18 04:28:24',1,NULL,'5662FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5733,119481,'A heterogeneous group of disorders that share glucose intolerance in common.','en',1,'2007-11-02 20:10:30',1,'2012-06-06 18:24:28','5733FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5743,119506,'Superficial infections of the skin or its appendages by any of various fungi.','en',1,'2007-10-18 04:28:24',1,NULL,'5743FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5750,119523,'Superficial infections of the skin or its appendages by any of various fungi.','en',1,'2007-10-18 04:28:24',1,NULL,'5750FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5764,119558,'Localized destruction of the tooth surface initiated by decalcification of the enamel followed by enzymatic lysis of organic structures and leading to cavity formation. If left unchecked, the cavity may penetrate the enamel and dentin and reach the pulp. The three most prominent theories used to explain the etiology of the disase are that acids produced by bacteria lead to decalcification; that micro-organisms destroy the enamel protein; or that keratolytic micro-organisms produce chelates that lead to decalcification.','en',1,'2007-11-02 20:08:47',1,'2011-12-22 18:39:36','5764FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5785,119656,'An ulceration caused by prolonged pressure in patients permitted to lie too still for a long period of time. The bony prominences of the body are the most frequently affected sites. The ulcer is caused by ischemia of the underlying structures of the skin, fat, and muscles as a result of the sustained and constant pressure.','en',1,'2007-10-18 04:28:24',1,NULL,'5785FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5799,119685,'Inflammation of the urinary bladder. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'5799FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(5938,120194,'Disorders or diseases associated with the six-to-eight-week period immediately following labor and delivery.','en',1,'2007-10-18 04:28:24',1,NULL,'5938FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6313,121262,'Infections by bacteria, general or unspecified.','en',1,'2007-10-18 04:28:24',1,NULL,'6313FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6363,121372,'A sudden intense and continuous aggravation of a state of asthma, marked by dyspnea to the point of exhaustion and collapse and not responding to the usual therapeutic efforts.','en',1,'2007-10-18 04:28:24',1,NULL,'6363FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6366,121375,'ugonjwa wa pumu','sw',1,'2007-12-11 21:17:36',1,'2013-05-07 14:24:50','6366FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6449,121629,'A reduction in the number of circulating erythrocytes or in the quantity of hemoglobin.','en',1,'2007-10-14 11:31:45',1,'2013-02-02 16:46:05','6449FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6450,121629,'ugonjwa wa kuvuja damu','sw',1,'2007-12-11 19:33:36',1,'2013-02-02 16:46:05','6450FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6722,122604,'An acute diarrheal disease endemic in India and Southeast Asia whose causative agent is VIBRIO CHOLERAE. This condition can lead to severe dehydration in a matter of hours unless quickly treated.','en',1,'2007-10-18 04:28:24',1,'2011-12-22 18:53:52','6722FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6890,123052,'A nutritional condition produced by a deficiency of VITAMIN A in the diet, characterized by NIGHT BLINDNESS and other ocular manifestations such as dryness of the conjunctiva and later of the cornea (XEROPHTHALMIA). Vitamin A deficiency is a very common problem worldwide, particularly in developing countries as a consequence of famine or shortages of vitamin A-rich foods. In the United States it is found among the urban poor, the elderly, alcoholics, and patients with malabsorption. (From Cecil Textbook of Medicine, 19th ed, p1179)','en',1,'2007-10-18 04:28:24',1,NULL,'6890FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6933,123123,'Inflammation, often mild, of the conjunctiva caused by a variety of viral agents. Conjunctival involvement may be part of a systemic infection.','en',1,'2007-10-18 04:28:24',1,NULL,'6933FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7066,123529,'DEF: Discharge of purulent fluid from the urethra. DESC: Commonly caused by Gonorrhea and/or chlamydia. REF: Merck Manual','en',1,'2007-10-18 04:28:24',1,NULL,'7066FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7067,123529,'ECOULEMENT URETRAL','fr',1,'2007-07-13 14:56:43',1,NULL,'7067FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7275,124129,'Infection with nematodes of the genus TRICHURIS, formerly called Trichocephalus.','en',1,'2007-10-18 04:28:24',1,NULL,'7275FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7773,126127,'Expulsion of the products of conception before the completion of gestation without deliberate interference.','en',1,'2007-10-18 04:28:24',1,NULL,'7773FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7801,126208,'Congenital defects of closure of one or more vertebral arches, which may be associated with malformations of the spinal cord, nerve roots, congenital fibrous bands, lipomas, and congenital cysts. These malformations range from mild (e.g., SPINA BIFIDA OCCULTA) to severe, including rachischisis where there is complete failure of neural tube and spinal cord fusion, resulting in exposure of the spinal cord at the surface. Spinal dysraphism includes all forms of spina bifida. The open form is called SPINA BIFIDA CYSTICA and the closed form is SPINA BIFIDA OCCULTA. (From Joynt, Clinical Neurology, 1992, Ch55, p34)','en',1,'2007-10-18 04:28:24',1,NULL,'7801FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7914,126558,'An infectious disease caused by bacteria of the genus SHIGELLA. This condition is characterized by intestinal pain and diarrhea.','en',1,'2007-10-18 04:28:24',1,NULL,'7914FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(8328,127579,'The persistence to perform a learned behavior (facts or experiences) after an interval has elapsed in which there has been no performance or practice of the behavior.','en',1,'2007-10-18 04:28:24',1,NULL,'8328FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),