CHE DISORDERS (e.g., MIGRAINE).','en',1,'2007-11-02 20:20:16',1,'2012-06-03 17:26:07','12141FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(12204,139277,'Anogenital ulcers caused by Calymmatobacterium granulomatis as distinguished from lymphogranuloma inguinale (see LYMPHOGRANULOMA VENEREUM) caused by CHLAMYDIA TRACHOMATIS. Diagnosis is made by demonstration of typical intracellular Donovan bodies in crushed-tissue smears.','en',1,'2007-10-18 04:28:24',1,NULL,'12204FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(12250,139355,'The presence of glucose in the urine, especially the excretion of an abnormally large amount of sugar (glucose) in the urine. (Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'12250FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(12730,140987,'Persistently high arterial blood pressure. Currently accepted threshold levels are 140 mm Hg systolic and 90 mm Hg diastolic pressure.','en',1,'2007-10-18 04:28:24',1,NULL,'12730FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(12832,141216,'A genus of intestinal nematode worms which includes the pinworm or threadworm Enterobius vermicularis.','en',1,'2007-10-18 04:28:24',1,NULL,'12832FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(13227,142473,'A heterogeneous group of disorders that share glucose intolerance in common.','en',1,'2007-10-18 04:28:24',1,NULL,'13227FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(14187,145762,'Acute, localized autoinoculable infectious disease usually acquired through sexual contact. Caused by HAEMOPHILUS DUCREYI, it occurs endemically almost worldwide, especially in tropical and subtropical countries and more commonly in seaports and urban areas than in rural areas.','en',1,'2007-10-18 04:28:24',1,NULL,'14187FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(14638,147241,'Bleeding or escape of blood from a vessel.','en',1,'2007-10-18 04:28:24',1,'2012-06-04 18:24:04','14638FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(14870,148023,'Passage of excessively liquid or excessively frequent stools.','en',1,'2007-10-18 04:28:24',1,NULL,'14870FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(149